import React, { useState, useMemo } from 'react';

import Pagination from '../Pagination';
import './style.scss';


 const Table = (props) => {

  const{data}=props;

  return (
    <>
      <table>
        <tr>
          <th>name</th>
          <th>email</th>
          <th>phone</th>
        </tr>
        {data.map((ele) => {
          return (
            <tr>
              <td>{ele.name}</td>
              <td>{ele.email}</td>
              <td>{ele.phone}</td>
            </tr>
          )
        })}
        <edit />
        <delete />

      </table>
    </>
  )
};

export default Table;
